import React from 'react';
import './styles.css';

const Home: React.FC = () => {
  return (
    <>

      <div className="home-container">  
          <p>
            <h1> <span> FT_TRANSCENDENCE </span> </h1>
          </p>
      </div>
      <div className="button-container">
        <button className="button-52" role="button">42_Login</button>
        <button className="button-52" role="button">SignIn</button>
        <button className="button-52" role="button">SignUp</button>
      </div>
    </>
  );
}


export default Home;
